package solution

import "testing"

func TestSolution1(t *testing.T) {
	input := "abcabcbb"
	ans := 3

	x := lengthOfLongestSubstring(input)
	if ans != x {
		t.Fatalf(`Uh-oh: lengthOfLongestSubstring(%v) = %v; expected %v`,
			input, x, ans)
	}
}

